l::is_coupon_emails_allowed.','The Legacy REST API plugin is not installed on this site.'=>'Vtičnik za zastareli REST API ni nameščen na tem spletišču.','The WooCommerce Legacy REST API plugin running on this site.'=>'Vtičnik za zastareli REST API WooCommerce teče na tem spletišču.','WooCommerce Legacy REST API package'=>'Paket za zastareli REST API WooCommerce','Copy for GitHub'=>'Kopiraj za GitHub','Legacy API v3 (⚠️ NOT AVAILABLE)'=>'Zastareli API v3 (⚠️ NI NA VOLJO)','⚠️ The WooCommerce Legacy REST API has been moved to <a target=”_blank” href="%1$s">a dedicated extension</a>. <b><a target=”_blank” href="%2$s">Learn more about this change</a></b>'=>'⚠️ Zastareli REST API WooCommerce je bil premaknjen v <a target=”_blank” href="%1$s">namensko razširitev</a>. <b><a target=”_blank” href="%2$s">Več o tej spremembi</a></b>','ℹ️️ The WooCommerce Legacy REST API extension is installed and active.'=>'ℹ️️ Razširitev Zastareli REST API WooCommerce je nameščena in dejavna.','The legacy REST API is NOT enabled'=>'Zastareli REST API NI omogočen','The legacy REST API is enabled'=>'Zastareli REST API je omogočen',' Your subscription expires on %1$s, <a href="%2$s" class="woocommerce-enable-autorenew">enable auto-renew</a> to continue receiving updates.'=>' Vaša naročnina poteče %1$s, <a href="%2$s" class="woocommerce-enable-autorenew">omogočite samodejno obnovitev</a>, če želite še naprej prejemati posodobitve.',' Your subscription expired, <a href="%1$s" class="woocommerce-renew-subscription">renew %2$s</a>to update.'=>' Vaša naročnina je potekla, <a href="%1$s" class="woocommerce-renew-subscription">obnovite %2$s</a> za posodobitev.','for %s '=>'za %s ','<a href=\'%s\'>More information</a>'=>'<a href=\'%s\'>Več podrobnosti</a>','This webhook has the ⚠️ symbol in front of its name in the list below. Please either edit the webhook to use a different delivery format, or install and activate <a href="%s" target="_blank">the WooCommerce Legacy REST API extension</a>.'=>'Ta webhook ima na spodnjem seznamu pred svojim imenom znak ⚠️. Uredite webhook tako, da bo uporabljal drugo obliko povezave, ali pa namestite in omogočite <a href="%s" target="_blank">razširitev WooCommerce Legacy REST API</a>.' . "\0" . 'Ta webhooka imata na spodnjem seznamu pred svojim imenom znak ⚠️. Uredite webhooka tako, da bosta uporabljala drugo obliko povezave, ali pa namestite in omogočite <a href="%s" target="_blank">razširitev WooCommerce Legacy REST API</a>.' . "\0" . 'Ti webhooki imajo na spodnjem seznamu pred svojim imenom znak ⚠️. Uredite webhooke tako, da bodo uporabljali drugo obliko povezave, ali pa namestite in omogočite <a href="%s" target="_blank">razširitev WooCommerce Legacy REST API</a>.' . "\0" . 'Ti webhooki imajo na spodnjem seznamu pred svojim imenom znak ⚠️. Uredite webhooke tako, da bodo uporabljali drugo obliko povezave, ali pa namestite in omogočite <a href="%s" target="_blank">razširitev WooCommerce Legacy REST API</a>.','There\'s %d webhook that is configured to be delivered using the Legacy REST API, which has been removed from WooCommerce. This webhook will fail to be sent.'=>'Obstaja %d webhook, ki je nastavljen za povezavo z zastarelim REST API-jem, ki je bil odstranjen iz WooCommerca. Tega webhooka ne bo mogoče poslati.' . "\0" . 'Obstajata %d webhooka, ki sta nastavljena za povezavo z zastarelim REST API-jem, ki je bil odstranjen iz WooCommerca. Teh webhookov ne bo mogoče poslati.' . "\0" . 'Obstajajo %d webhooki, ki so nastavljeni za povezavo z zastarelim REST API-jem, ki je bil odstranjen iz WooCommerca. Teh webhookov ne bo mogoče poslati.' . "\0" . 'Obstaja %d webhookov, ki so nastavljeni za povezavo z zastarelim REST API-jem, ki je bil odstranjen iz WooCommerca. Teh webhookov ne bo mogoče poslati.','Incompatible webhooks warning'=>'Opozorilo o nezdružljivih webhookih','This webhook is configured to be delivered using the Legacy REST API, but the Legacy REST API plugin is not installed on this site.'=>'Ta webhook je nastavljen za uporabo z zastarelim REST API-jem, vendar na tem spletišču ni nameščen vtičnik za zastareli REST API .','block descriptionShows the subtotal, fees, discounts, shipping and taxes.'=>'Pokaže delni znesek, stroške, popuste, dostavo in davke.','block titleTotals'=>'Skupaj','block titleComing Soon'=>'Kmalu na voljo','Store coming soon'=>'Trgovina bo kmalu na voljo','⚠ <b><a target="_blank" href="%s">The Legacy REST API</a> is active on this site.</b> Please be aware that the WooCommerce Legacy REST API is <b>not</b> compatible with HPOS.'=>'⚠ <b>Na tem spletišču je dejaven <a target="_blank" href="%s">zastareli REST API</a>.</b> Upoštevajte, da zastareli REST API WooCommerce <b>ni</b> združljiv s HPOS.','⚠ <b><a target="_blank" href="%s">The Legacy REST API plugin</a> is installed and active on this site.</b> Please be aware that the WooCommerce Legacy REST API is <b>not</b> compatible with HPOS.'=>'⚠ <b>Na tem spletišču je nameščen in dejaven <a target="_blank" href="%s">vtičnik za zastareli REST API</a>.</b> Upoštevajte, da zastareli REST API WooCommerce <b>ni</b> združljiv s HPOS.','Track inventory'=>'Sledite zalogi','Data in posts table appears to be more recent than in HPOS tables. Compare order data with `wp wc hpos diff %1$d` and use `wp wc hpos backfill %1$d --from=posts --to=hpos` to fix.'=>'Zdi se, da so podatki v tabeli prispevkov novejši, kot v tabelah HPOS. Primerjajte podatke o naročilih z `wp wc hpos diff %1$d` in za popravek uporabite `wp wc hpos backfill %1$d --from=posts --to=hpos`.','⚠️ The file system connection could not be initialized.'=>'⚠️ Povezave z datotečnim sistemom ni bilo mogoče začeti.','You may want to switch to the database for log storage.'=>'Morda boste želeli za shranjevanje dnevnika preklopiti na zbirko podatkov.','⚠️ The file system is not configured for direct writes. This could cause problems for the logger.'=>'⚠️ Datotečni sistem ni nastavljen za neposredno pisanje. To lahko povzroči težave za zapisovalnik.','✅ Ready'=>'✅ Pripravljen','Cleanup completed for %d order. Review errors above.'=>'Čiščenje je zaključeno za %d naročilo. Preglejte zgornje napake.' . "\0" . 'Čiščenje je zaključeno za %d naročili. Preglejte zgornje napake.' . "\0" . 'Čiščenje je zaključeno za %d naročila. Preglejte zgornje napake.' . "\0" . 'Čiščenje je zaključeno za %d naročil. Preglejte zgornje napake.','Failed to clean up all orders in a batch. Aborting.'=>'Ni uspelo počistiti vseh naročil v paketu. Prekinitev.','Template namePage: Coming soon'=>'Stran: kmalu na voljo','Hide shipping costs until an address is entered (Not available when using the <a href="%s">Local pickup options powered by the Checkout block</a>)'=>'Skrij stroške dostave, dokler ni vnesen naslov (ni na voljo pri uporabi <a href="%s">možnosti osebnega prevzema, ki jih omogoča blok zaključka nakupa</a>)','<a id="woo-connect-notice-url" href="%s">Connect your store</a> to WooCommerce.com to get updates and streamlined support for your subscriptions.'=>'<a id="woo-connect-notice-url" href="%s">Povežite svojo trgovino</a> z WooCommerce.com, če želite prejemati posodobitve in poenostavljeno podporo za svoje naročnine.','Your store might be at risk as you are running old versions of WooCommerce plugins.'=>'Vaša trgovina je lahko ogrožena, saj uporabljate stare različice vtičnikov WooCommerce.','Select your shipping options'=>'Izberite vaše možnosti dostave','
