		','Attribution'=>'Vir','Order attribution information.'=>'Podatki o viru naročila.','Something big is brewing! Our store is in the works and will be launching soon!'=>'Nekaj ​​velikega se pripravlja! Naša trgovina je v pripravi in ​​bo kmalu odprta!','Great things are on the horizon'=>'Na obzorju so velike stvari','Name of credit cardCartes Bancaires'=>'Cartes Bancaires','There was an error processing your order. Please check for any charges in your payment method and review your <a href="%s">order history</a> before placing the order again.'=>'Med obdelavo vašega naročila je prišlo do napake. Preverite morebitne stroške za izbran način plačila in preglejte <a href="%s">zgodovino naročil</a>, preden ga znova oddate.',' <a href="%1$s" class="woocommerce-connect-your-store">Connect your store</a> to woocommerce.com to update.'=>' <a href="%1$s" class="woocommerce-connect-your-store">Povežite svojo trgovino</a> z woocommerce.com za posodobitev.','block descriptionThe product custom fields.'=>'Prilagojena polja izdelka.','block titleProduct custom fields control'=>'Nadzor prilagojenih polj izdelka','block keywordfields'=>'polja','block keywordcustom'=>'po meri','block descriptionThe product custom fields toggle.'=>'Preklop prilagojenih polj izdelka.','block titleProduct custom fields toggle control'=>'Nadzor preklopa prilagojenih polj izdelka','block keywordselect'=>'izberi','block descriptionA select field for use in the product editor.'=>'Izbirno polje za uporabo v urejevalniku izdelkov.','block titleProduct select field'=>'Izbirno polje v izdelku','Site visibility'=>'Vidnost spletišča','Live'=>'Javno','Approving will share credentials with %s. Do not proceed if this looks suspicious in any way.'=>'Odobritev bo delila poverila z %s. Ne nadaljujte, če je to videti sumljivo.','Plugin installed by %1$s on %2$s.'=>'Vtičnik je namestil/-a %1$s dne %2$s.','Plugin installed by %1$s on %2$s. <a target="_blank" href="%3$s">More information</a>'=>'Vtičnik je namestil/-a %1$s dne %2$s. <a target="_blank" href="%3$s">Več podrobnosti</a>','Enter an optional note attached to the order confirmation message sent to the shopper.'=>'Vnesite neobvezno opombo, pripeto sporočilu o potrditvi naročila, poslanemu kupcu.','Post-purchase note'=>'Obvestilo po nakupu','Custom fields can be used in a variety of ways, such as sharing more detailed product information, showing more input fields, or for internal inventory organization. %1$sRead more about custom fields%2$s'=>'Polja po meri je mogoče uporabiti na različne načine, kot je deljenje podrobnejših podatkov o izdelku, prikaz več vnosnih polj ali za notranje organizacijo zaloge. %1$sPreberite več o poljih po meri%2$s','Custom fields'=>'Polja po meri','Show custom fields'=>'Pokaži polja po meri','Use global attributes to allow shoppers to filter and search for this product. Use custom attributes to provide detailed product information.'=>'Uporabite globalne atribute, da omogočite kupcem filtriranje in iskanje tega izdelka. Uporabite atribute po meri za zagotavljanje podrobnih podatkov o izdelku.','Per your %1$sstore settings%2$s, taxes are not enabled.'=>'Davki niso omogočeni zaradi %1$snastavitev trgovine%2$s.','Unable to create backup post for order %d.'=>'Ni mogoče ustvariti varnostne kopije prispevka za naročilo %d.','%s is not a valid order property.'=>'%s ni veljavna lastnost naročila.' . "\0" . '%s nista veljavni lastnosti naročila.' . "\0" . '%s niso veljavne lastnosti naročila.' . "\0" . '%s niso veljavne lastnosti naročila.','%s is an internal meta key. Use --props to set it.'=>'%s je notranji meta ključ. Za nastavitev uporabite --props.' . "\0" . '%s sta notranja meta ključa. Za nastavitev uporabite --props.' . "\0" . '%s so notranji meta ključi. Za nastavitev uporabite --props.' . "\0" . '%s so notranji meta ključi. Za nastavitev uporabite --props.','The backup datastore does not support updating orders.'=>'Zasilna podatkovna shramba ne podpira posodabljanja naročil.','New custom field name'=>'Novo ime polja po meri','Please review the errors above.'=>'Preglejte zgornje napake.','WooCommerce Blocks development mode requires files to be built. From the root directory, run %1$s to ensure your node version is aligned, run %2$s to install dependencies, %3$s to build the files or %4$s to build the files and watch for changes.'=>'Razvojni način blokov za WooCommerce zahteva izgradnjo datotek. Iz korenske mape zaženite %1$s, da zagotovite, da je vaša različica node usklajena, zaženite %2$s za namestitev odvisnosti, %3$s za izgradnjo datotek ali %4$s za izgradnjo datotek in opazovanje sprememb.','Overriding existing data with an already registered key is not allowed'=>'Prepis obstoječih podatkov z že registriranim ključem ni dovoljen','Key for the data being registered must be a string'=>'Ključ za podatke, ki se registrirajo, mora biti niz','The metaboxhidden_product meta from the user metas.'=>'metaboxhidden_product iz meta podatkov uporabnika.','Set up your payment methods and accept credit and debit cards, cash, bank transfers and money from your Mercado Pago account. Offer safe and secure payments with Latin America’s leading processor.'=>'Nastavite načine plačila in sprejemajte kreditne in debetne kartice, gotovino, bančna nakazila in denar z računa Mercado Pago. Ponudite varna in zaščitena plačila z vodilnim obdelovalnikom v Latinski Ameriki.','Mercado Pago'=>'Mercado Pago','Collect sales tax'=>'Zbirajte davke od prodaje','Add your products'=>'Dodajte vaše izdelke','Get paid'=>'Bodite plačani','Grow your business'=>'Razvijte svoje podjetje','It\'s time to celebrate – you\'re ready to launch your store! Woo! Hit the button to preview your store and make it public.'=>'Čas je za praznovanje – pripravljeni ste na odprtje svoje trgovine! Vau! Pritisnite gumb za predogled vaše trgovine in jo objavite.','Launch your store'=>'Zaženite svojo trgovino','Get your products shipped'=>'Dostavite svoje izdelke','Current price is: %s.'=>'Trenutna cena je: %s.','Original price was: %s.'=>'Izvirna cena je bila: %s.','Checkout can be customized <a href="%s">in the Editor</a> with your active theme.'=>'Zaključek nakupa lahko prilagodite <a href="%s">v urejevalniku</a> z vašo dejavno temo.','⚠️ WooCommerce attempted to install <a href="%1$s">the Legacy REST API plugin</a> because this site has <a href="%2$s">the Legacy REST API enabled</a> or has <a href="%3$s">legacy webhooks defined</a>, but the installation failed (see error details in <a href="%4$s">the WooCommerce logs</a>). Please install and activate the plugin manually. <a href="%5$s">More information</a>'=>'⚠️ WooCommerce je poskušal namestiti <a href="%1$s">vtičnik za zastareli REST API</a>, ker ima to spletišče <a href="%2$s">omogočen zastareli REST API</a> ali ima <a href="%3$s">določene zastarele webhooke</a>, vendar namestitev ni uspela (podrobnosti o napaki najdete v <a href="%4$s">dnevnikih WooCommerca</a>). Namestite in omogočite vtičnik ročno. <a href="%5$s">Več podrobnosti</a>','ℹ️ WooCommerce installed and activated <a href="%1$s">the Legacy REST API plugin</a> because this site has <a href="%2$s">the Legacy REST API enabled</a> or has <a href="%3$s">legacy webhooks defined</a>. <a href="%4$s">More information</a>'=>'ℹ️ WooCommerce je namestil in omogočil <a href="%1$s">vtičnik za zastareli REST API</a>, ker ima to spletišče <a href="%2$s">omogočen zastareli REST API</a> ali ima <a href="%3$s">določene zastarele webhooke</a>. <a href="%4$s">Več podrobnosti</a>','WooCommerce installed the Legacy REST API plugin but failed to activate it, see context for more details.'=>'WooCommerce je namestil vtičnik za zastareli REST API, vendar ga ni uspel omogočiti. Za več podrobnosti si oglejte kontekst.','⚠️ WooCommerce installed <a href="%1$s">the Legacy REST API plugin</a> because this site has <a href="%2$s">the Legacy REST API enabled</a> or has <a href="%3$s">legacy webhooks defined</a>, but it failed to activate it (see error details in <a href="%4$s">the WooCommerce logs</a>). Please go to <a href="%5$s">the plugins page</a> and activate it manually. <a href="%6$s">More information</a>'=>'⚠️ WooCommerce je namestil <a href="%1$s">vtičnik za zastareli REST API</a>, ker ima to spletišče <a href="%2$s">omogočen zastareli REST API</a> ali <a href="%3$s">določene zastarele webhooke</a>, vendar ga ni uspelo omogočiti (podrobnosti o napaki najdete v <a href="%4$s">dnevnikih WooCommerca</a>). Obiščite <a href="%5$s">stran z vtičniki</a> in ga omogočite ročno. <a href="%6$s">Več podrobnosti</a>','Please enter a valid email at checkout to use coupon code "%s".'=>'Na zaključku nakupa vnesite veljaven e-poštni naslov, če želite uporabiti kodo kupona »%s«.','Please enter a valid email to use coupon code "%s".'=>'Vnesite veljaven e-poštni naslov, če želite uporabiti kodo kupona »%s«.','To allow logging, make %s writable.'=>'Če želite omogočiti beleženje, naredite %s zapisljivo.','Local pickup: Set up pickup locations in the <a href="%s">Local pickup settings page</a>.'=>'Osebni prevzem: nastavite mesta prevzema na <a href="%s">strani z nastavitvami osebnega prevzema</a>.','Explore a new enhanced delivery method that allows you to easily offer one or more pickup locations to your customers in the <a href="%s">Local pickup settings page</a>.'=>'Raziščite nov izboljšan način dostave, ki vam omogoča, da svojim strankam preprosto ponudite eno ali več prevzemnih mest na <a href="%s">strani z nastavitvami osebnega prevzema</a>.','Gathering usage data allows us to tailor your store setup experience, offer more relevant content, and help make WooCommerce better for everyone.'=>'Zbiranje podatkov o uporabi nam omogoča, da prilagodimo vašo izkušnjo nastavitve trgovine, ponudimo ustreznejšo vsebino in pomagamo izboljšati WooCommerce za vse.','Please <a href="%1$s">Install the WooCommerce.com Update Manager</a> to continue receiving the updates and streamlined support included in your WooCommerce.com subscriptions. Alternatively, you can <a href=