akcije z WooPayments.','Start by adding the first product to your store. You can add your products manually, via CSV, or import them from another service.'=>'Začnite z dodajanjem prvega izdelka v vašo trgovino. Izdelke lahko dodate ročno, preko CSV ali jih uvozite iz druge storitve.','Your store address is required to set the origin country for shipping, currencies, and payment options.'=>'Naslov vaše trgovine je zahtevan za nastavitev države izvora za dostavo, valute in možnosti plačila.','Set your store location and configure tax rate settings.'=>'Nastavite lokacijo trgovino in davčne stopnje.','Grow your store'=>'Povečajte vašo trgovino','The rate at which tax is applied.'=>'Uveljavljena davčna stopnja.','Notes are unavailable because the "admin-note" data store cannot be loaded.'=>'Opombe niso na voljo, ker ni mogoče naložiti shrambe podatkov "admin-note".','Get backups'=>'Dobi varnostne kopije','Store downtime means lost sales. One-click restores get you back online quickly if something goes wrong.'=>'Nedelovanje trgovine pomeni izgubo prodaje. Obnovitve z enim klikom vas hitro vrnejo v splet, če gre kaj narobe.','Protect your WooCommerce Store with Jetpack Backup.'=>'Zaščitite vašo trgovino WooCommerce z Jetpack Backup.','Mollie'=>'Mollie','The Payfast extension for WooCommerce enables you to accept payments by Credit Card and EFT via one of South Africa’s most popular payment gateways. No setup fees or monthly subscription costs. Selecting this extension will configure your store to use South African rands as the selected currency.'=>'Razširitev Payfast za WooCommerce vam omogoča sprejemanje plačil s kreditno kartico in EFT preko enega najbolj priljubljenih plačilnih sistemov v Južni Afriki. Brez stroškov nastavitve ali mesečnih stroškov naročnine. Če izberete to razširitev, bo vaša trgovina nastavljena za uporabo južnoafriških randov kot izbrane valute.','Number of variation items sold.'=>'Število prodanih različic izdelkov.','Variations Sold'=>'Prodanih različic','Number of product items sold.'=>'Število prodanih izdelkov.','Products sold'=>'Prodanih izdelkov','Source of note.'=>'Vir opombe.','Data store:'=>'Shramba podatkov:','This section shows details of Action Scheduler.'=>'Ta odsek prikazuje podrobnosti Načrtovalnika dejanj.','Products by Rating list'=>'Seznam izdelkov po oceni','Recently Viewed Products list'=>'Seznam nedavno ogledanih izdelkov','Change status to cancelled'=>'Spremeni stanje v Preklicano','Download %d ID'=>'Prenos %d ID','Things to do next'=>'Prihodnja opravila','Manage transactions without leaving your WordPress Dashboard. Only with WooPayments.'=>'Upravljajte transakcije, ne da bi zapustili nadzorno ploščo WordPressa. Samo z WooPayments.','Create and send purchase follow-up emails, newsletters, and promotional campaigns straight from your dashboard.'=>'Ustvarite in pošiljajte e-poštna sporočila, glasila in promocijske kampanje neposredno z nadzorne plošče.','Invalid path provided.'=>'Podana neveljavna pot.','How easy was it to add a product tag?'=>'Kako lahko je bilo dodati oznako izdelka?','A link to a product.'=>'Povezava na izdelek.','Product Link'=>'Povezava izdelka','A link to a product tag.'=>'Povezava na oznako izdelka.','Product Tag Link'=>'Povezava oznake izdelka','A link to a product category.'=>'Povezava na kategorijo izdelka.','Product Category Link'=>'Povezava kategorije izdelka','To ensure your store&rsquo;s notifications arrive in your and your customers&rsquo; inboxes, we recommend connecting your email address to your domain and setting up a dedicated SMTP server. If something doesn&rsquo;t seem to be sending correctly, install the <a href="%1$s">WP Mail Logging Plugin</a> or check the <a href="%2$s">Email FAQ page</a>.'=>'Da zagotovite, da bodo obvestila vaše trgovine prispela do nabiralnika vas in vaših strank, priporočamo, da vaš e-poštni naslov povežete z vašo domeno in nastavite namenski strežnik SMTP. Če se zdi, da se nekaj ne pošilja pravilno, namestite <a href="%1$s">v