ogoče kupiti. Odstranite jih iz vaše košarice.','%s is out of stock and cannot be purchased. Please remove it from your cart.'=>'%s ni na zalogi in ga ni mogoče kupiti. Odstranite ga iz vaše košarice.','Tax class slug is invalid'=>'Ključ davčnega razreda ni veljaven','City name, it doesn\'t support multiple values. Deprecated as of WooCommerce 5.3, \'cities\' should be used instead.'=>'Ime mesta, ki ne podpira več vrednosti. Opuščeno v različici WooCommerce 5.3. Namesto tega bi morali uporabiti \'cities\'.','Postcode/ZIP, it doesn\'t support multiple values. Deprecated as of WooCommerce 5.3, \'postcodes\' should be used instead.'=>'Poštna številka, ki ne podpira več vrednosti. Opuščeno v različici WooCommerce 5.3. Namesto tega bi morali uporabiti \'postcodes\'.','List of city names. Introduced in WooCommerce 5.3.'=>'Seznam imen mest. Predstavljeno v WooCommercu 5.3.','List of postcodes / ZIPs. Introduced in WooCommerce 5.3.'=>'Seznam poštnih številk. Predstavljeno v WooCommercu 5.3.','Amount that will be refunded for this tax.'=>'Znesek, ki bo povrnjen za ta davek.','Amount that will be refunded for this line item (excluding taxes).'=>'Znesek, ki bo povrnjen za ta predmet vrstice (brez davkov).','Low Stock amount for the variation.'=>'Nizka zaloga za različico.','Limit result set to resources assigned to a specific parent. Applies to hierarchical taxonomies only.'=>'Omeji rezultate na vire dodeljene določenemu nadrejenemu. Uveljavi se samo za hierarhične taksonomije.','Offset the result set by a specific number of items. Applies to hierarchical taxonomies only.'=>'Zamakni nabor rezultatov za določeno število predmetov. Uveljavi se samo za hierarhične taksonomije.','Low Stock amount for the product.'=>'Nizka zaloga za izdelek.','Coupon item ID is readonly.'=>'ID predmeta kupona je samo za branje.','Search for a page&hellip;'=>'Najdite stran &hellip;','Additional tax class "%1$s" couldn\'t be saved. %2$s.'=>'Dodatnega davčnega razreda "%1$s" ni bilo mogoče shraniti. %