Prva vrstica naslova, na katerega se dostavlja.','Limit result set to products based on a maximum price, provided using the smallest unit of the currency.'=>'Omeji rezultate na izdelke glede na najvišjo ceno, podano glede na najmanjšo enoto valute.','Limit result set to products based on a minimum price, provided using the smallest unit of the currency.'=>'Omeji rezultate na izdelke glede na najnižjo ceno, podano glede na najmanjšo enoto valute.','Maximum number of items to be returned in result set. Defaults to no limit if left blank.'=>'Največje število predmetov za vrnitev v naboru rezultatov. Če je prazno, privzeto ni omejeno.','Invalid category ID.'=>'Neveljaven ID kategorije.','WooCommerce %1$s table creation failed. Does the %2$s user have CREATE privileges on the %3$s database?'=>'Ustvarjanje WooCommercove tabele %1$s ni uspelo. Ali ima uporabnik %2$s za podatkovno zbirko %3$s dovoljenje CREATE?','Verifying database... One or more tables are still missing: '=>'Preverjanje podatkovne zbirke ... ena ali več tabel še vedno manjka: ','Database verified successfully.'=>'Podatkovna zbirka uspešno preverjena.','You need WooCommerce 4.2 or newer to run this tool.'=>'Za zagon tega orodja potrebujete WooCommerce 4.2 ali novejšega.','The active version of WooCommerce does not support template cache clearing.'=>'Dejavna različica WooCommerca ne podpira čiščenje predpomnilnika predlog.','Template cache cleared.'=>'Predpomnilnik predlog počiščen.','Verify if all base database tables are present.'=>'Preveri, če so prisotne vse tabele podatkovne zbirke.','Verify database'=>'Preveri podatkovno zbirko','Verify base database tables'=>'Preveri tabele podatkovne zbirke','This tool will empty the template cache.'=>'To orodje bo izpraznilo predpomnilnik predlog.','Clear template cache'=>'Počisti predpomnilnik predlog','Collect and validate EU VAT numbers at checkout'=>'Zbiraj in preverjaj številke DDV v EU ob zaključku nakupa','If your store is based in the EU, we recommend using the EU VAT Number extension in addition to automated taxes. It provides your checkout with a field to collect and validate a customer\'s EU VAT number, if they have one.'=>'Če ima vaša trgovina sedež v EU, priporočamo, da poleg samodejnih davkov uporabite razširitev EU VAT Number. V vašem zaključku nakupa nudi polje za zbiranje in potrditev EU številke DDV, če jo stranka ima.','Get real-time order alerts anywhere'=>'Kamorkoli prejmite realnočasovna opozorila o naročilih','Get notifications about store activity, including new orders and product reviews directly on your mobile devices with the Woo app.'=>'Prejemajte obvestila o dejavnosti trgovine, vključno z novimi naročili in mnenji o izdelkih, neposredno na vaše mobilne naprave z aplikacijo Woo.','First order received'=>'Prejeto je bilo prvo naročilo','This video tutorial will help you go through the process of adding your first product in WooCommerce.'=>'Ta video vodnik vam bo pomagal pri postopku dodajanja vašega prvega izdelka v WooCommerce.','Do you need help with adding your first product?'=>'Potrebujete pomoč pri dodajanju vašega prvega izdelka?','Starting a fashion website is exciting but it may seem overwhelming as well. In this article, we\'ll walk you through the setup process, teach you to create successful product listings, and show you how to market to your ideal audience.'=>'Ustanoviti modno spletišče je vznemirljivo, vendar se morda zdi tudi prenaporno. V tem članku vas bomo vodili skozi postopek namestitve, vas naučili ustvariti uspešne sezname izdelkov in vam pokazali, kako tržiti vašemu idealnemu občinstvu.','Start your online clothing store'=>'Odprite svojo spletno trgovino z oblačili','The admin note layout has a wrong prop value.'=>'Postavitev skrbniške opombe ima napačno vrednost prop.','Watch tutorial'=>'Ogled vodnika','Share feedback'=>'Delite odziv','Now that you’ve chosen us as a partner, our goal is to make sure we\'re providing the right tools to meet your needs. We\'re looking forward to having your feedback on the store setup experience so we can improve it in the future.'=>'Zdaj, ko ste nas izbrali za partnerja, je naš cilj zagotoviti, da vam nudimo prava orodja za izpolnjevanje vaših potreb. Veselimo se vašega odziva o izkušnji nastavitve trgovine, da jo bomo lahko v prihodnosti izboljšali.','Changing eCommerce platforms might seem like a big hurdle to overcome, but it is easier than you might think to move your products, customers, and orders to WooCommerce. This article will help you with going through this process.'=>'Spreminjanje prodajnih platform se morda zdi velika ovira, ki jo je treba premagati, vendar je selitev vaših izdelkov, strank in naročil v WooCommerce lažja, kot si mislite. Ta članek vam bo pomagal pri prehodu skozi ta postopek.','Do you want to migrate from Shopify to WooCommerce?'=>'Ali se želite preseliti iz Shopify v WooCommerce?','WooCommerce Subscriptions allows you to introduce a variety of subscriptions for physical or virtual products and services. Create product-of-the-month clubs, weekly service subscriptions or even yearly software billing packages. Add sign-up fees, offer free trials, or set expiration periods.'=>'WooCommerce Subscriptions vam omogočajo uvedbo različnih naročnin za fizične ali virtualne izdelke in storitve. Ustvarite klube izdelkov meseca, tedenske naročnine na storitve ali celo letne pakete zaračunavanja programske opreme. Dodajte stroške za prijavo, ponudite brezplačne preizkuse ali nastavite obdobja poteka.','Do you need more info about WooCommerce Subscriptions?'=>'Potrebujete več podrobnosti o WooCommerce Subscriptions?','There was a problem activating some of the requested plugins.'=>'Med omogočanjem nekaterih zahtevanih vtičnikov je prišlo do napake.','Plugins were successfully activated.'=>'Vtičniki so bili uspešno omogočeni.','The requested plugin `%s`. is not yet installed.'=>'Zahtevan vtičnik `%s`. še ni nameščen.','There was a problem installing some of the requested plugins.'=>'Med na