mmerce-a. Predlogi za popravke:','Export all categories'=>'Izvoz vse kategorije','Which product category should be exported?'=>'Katere kategorije izdelkov bodo izvožene?','This is the attachment ID, or image URL, used for placeholder images in the product catalog. Products with no image will use this.'=>'To je ID priponke ali naslov URL slike, ki bo uporabljen za slike vsebnikov v katalogu izdelkov. Slika bo prikazana bo na izdelkih brez slik.','Enter attachment ID or URL to an image'=>'Vnesite ID priponke ali naslov URL do slike','Placeholder image'=>'Slika vsebnika (angl. placeholder)','The "%s" payment method is currently disabled'=>'Način plačila "%s" je trenutno onemogočen','The "%s" payment method is currently enabled'=>'Način plačila "%s" je trenutno omogočen','Set up the "%s" payment method'=>'Nastavi "%s" način plačila','Manage the "%s" payment method'=>'Upravljaj z načinom plačila "%s"','Move down'=>'Premakni dol','Move the "%s" payment method down'=>'Premakni način plačila "%s" dol','Move up'=>'Premakni gor','Move the "%s" payment method up'=>'Prestavi "%s" način plačila gor','When handling an %s, should access to downloadable files be revoked and download logs cleared?'=>'Ali naj bodo ob obravnavanju %s dostopi do prenosov preklicani in dnevniki prenosov počiščeni?','When handling an %s, should personal data within orders be retained or removed?'=>'Ali naj bodo ob obravnavanju %s zasebni podatki znotraj naročil ohranjeni ali odstranjeni?','Enter a number to set stock quantity at the variation level. Use a variation\'s \'Manage stock?\' check box above to enable/disable stock management at the variation level.'=>'Vnesite številko, da nastavite zalogo na ravni različice. Uporabite zgornje potrditveno polje različice \'Upravljanje z zalogo?\', da omogočite/onemogočite upravljanje z zalogo na ravni različice.','Low stock amount'=>'Nizka zaloga','Set up PayPal for me using this email:'=>'Nastavite PayPal za ta e-mail:','WooCommerce PayPal Checkout Gateway'=>'WooCommerce PayPal Checkout Gateway','Set up Stripe for me using this email:'=>'Nastavite Stripe za ta email:','We\'ll use %1$s for product weight and %2$s for product dimensions.'=>'Uporabili bomo %1$s za težo izdelka in %2$s za dimenzije izdelka.','ShipStation'=>'ShipStation','ShipStation icon'=>'Ikona ShipStation','We recommend using ShipStation to save time at the post office by printing your shipping labels at home. Try ShipStation free for 30 days.'=>'Priporočamo uporabo ShipStation za prihranitev časa na pošti, tako da sami doma natisnete nalepke. Poskusite ShipStation zastonj za 30 dni.','WooCommerce Services icon'=>'Ikona WooCommerce Services','A live rate is the exact cost to ship an order, quoted directly from the shipping carrier.'=>'Živa cena je točni strošek dostave, pridobljen s strani dostavne službe.','If you\'d like to offer <span class="help_tip" data-tip="%1$s">live rates</span> from a specific carrier (e.g. UPS) you can find a variety of extensions available for WooCommerce <a href="%2$s" target="_blank">here</a>.'=>'Če bi želeli ponuditi <span class="help_tip" data-tip="%1$s">aktualne cene</span> določene dostavne službe (npr. UPS) lahko najdete <a href="%2$s" target="_blank">tu</a> različne razširitve za WooCommerce.','We\'ve created two Shipping Zones - for %s and for the rest of the world. Below you can set Flat Rate shipping costs for these Zones or offer Free Shipping.'=>'Ustvarili smo dve območji dostave - za %s in preostanek sveta. Spodaj lahko za ti območji nastavite stroške osnovne stopnje dostave ali ponudite brezplačno dostavo.','Yards'=>'Jardi','Inches'=>'Inči','Millimeters'=>'Milimetri','Centimeters'=>'Centimetri','Meters'=>'Metri','Ounces'=>'Unča','Pounds'=>'Funti','Grams'=>'Grami','Kilograms'=>'Kilogrami','Item moved down'=>'Element premaknjen dol','Item moved up'=>'Element premaknjen gor','You may need to manually restore the item\'s stock.'=>'Zalogo izdelka boste morda morali ročno obnoviti.','Are you sure you want to remove the selected items?'=>'Ali ste prepričani, da želite odstraniti izbrane elemente?','Alto Paraguay'=>'Alto Paragvaj','Presidente Hayes'=>'Presidente Hayes','Amambay'=>'Amambay','Central'=>'Central','Cordillera'=>'Cordillera','San Pedro'=>'San Pedro','Sud Sardegna'=>'Južna Sardinija','Apartment, suite, unit, etc.'=>'Stanovanje, poslovni prostor, enota, itd.','%d API key permanently revoked.'=>'%d ključ API je bil trajno preklican.' . "\0" . '%d ključa API sta bila trajno preklicana.' . "\0" . '%d ključi API so bili trajno preklicani.' . "\0" . '%d ključev API je bilo trajno preklicanih.','Cannot set attributes due to invalid parent product.'=>'Atributov ni mogoče nastaviti, saj je nadrejeni izdelek neveljaven.','This action cannot be reversed. Are you sure you wish to erase personal data from the selected orders?'=>'Dejanja ni mogoče razveljaviti. Ali ste prepričani, da želite izbrisati osebne podatke iz izbranih naročil?','shipping packagesShipping %d'=>'Dostava %d','Payer PayPal address'=>'PayPal naslov plačnika','Payer last name'=>'Priimek plačnika','Payer first name'=>'Ime plačnika','Shipping Address'=>'Naslov za dostavo','Billing Address'=>'Naslov plačnika','Shipping Address 1'=>'Naslov za dostavo 1','Billing Address 1'=>'Naslov plačnika 1','MySQL version string.'=>'Niz različice MySQL-a.','Your CSV needs to include columns in a specific order. %1$sClick here to download a sample%2$s.'=>'Vaša datoteka CSV mora vsebovati določen vrstni red stolpcev. %1$sKliknite tukaj za prenos vzorca%2$s.','This will be how your name will be displayed in the account section and in reviews'=>'Tako bo prikazano vaše ime znotraj razdelka vašega računa in med mnenji','If you have a coupon code, please apply it below.'=>'Če imate kodo kupona, jo lahko unovčite spodaj.','terms and conditions'=>'pogoji poslovanja','privacy policy'=>'pravilnik o zasebnosti','United States (US) dollar'=>'Ameriški dolar (USD)','eCheck ending in %1$s'=>'eCheck končujoč z %1$s','PayPal allows us to send one address. If you are using PayPal for shipping labels you may prefer to send the shipping address rather than billing. Turning this option off may prevent PayPal Seller protection from applying.'=>'PayPal nam omogoča pošiljanje enega naslova. Če uporabljate PayPal za dostavne nalepke, boste morda raje poslali naslov dostave namesto naslova plačnika. Izklop te možnosti lahko prepreči uporabo zaščite prodajalca na PayPalu.','PayPal Standard redirects customers to PayPal to enter their payment information.'=>'PayPal Standard preusmeri stranke na PayPal stran, da vnesejo svoje plačilne podatke.','Other locations'=>'Druge lokacije','%1$s &ndash; %2$s'=>'%1$s &ndash; %2$s','%1$s (#%2$s)'=>'%1$s (št. %2$s)','Any &quot;%1$s&quot; method'=>'Katerikoli način &quot;%1$s&quot;','Take payments in person via checks. This offline gateway can also be useful to test purchases.'=>'Sprejmite plačila preko čekov. Ta nepovezan plačilni sistem je uporaben tudi za preizkusne nakupe.','Account details:'=>'Podrobnosti računa:','Take payments in person via BACS. More commonly known as direct bank/wire transfer.'=>'Sprejmite plačila preko bančnega nakazila.','Comma-separated list of search stopwords in your languageabout,an,are,as,at,be,by,com,for,from,how,in,is,it,of,on,or,that,the,this,to,was,what,when,where,who,will,with,www'=>'ali,bil,bila,bile,bili,bilo,bo,bodo,bosta,com,h,je,k,kaj,kako,katerega,katerem,kateremu,kateri,katerim,kdo,ki,kje,ko,kot,o,ob,od,na,pri,so,sta,ta,te,tega,tej,tem,temu,to,v,www,z,za','Optionally add some text for the terms checkbox that customers must accept.'=>'Izbirno dodajte besedilo k potrditvenem polju za pogoje, katere morajo sprejeti stranke.','%s page'=>'Stran %s','No page set'=>'Stran ni nastavljena','Highlight required fields with an asterisk'=>'Poudari zahtevana polja z zvezdico','I have read and agree to the website %s'=>'Prebral/-a sem in strinjam se s %s spletne strani','Required'=>'Zahtevano','%s field'=>'Polje %s','These options let you change the appearance of the WooCommerce checkout.'=>'Te možnosti omogočajo spremembe videza zaključka nakupa v WooCommerce.','Please see the <a href="https://www.paypal.com/us/webapps/mpp/ua/privacy-full">PayPal Privacy Policy</a> for more details.'=>'Oglejte si <a href="https://www.paypal.com/us/webapps/mpp/ua/privacy-full">PayPal Pravilnik o zasebnosti</a> za več podorbnosti.','We accept payments through PayPal. When processing payments, some of your data will be passed to PayPal, including information required to process or support the payment, such as the purchase total and billing information.'=>'Sprejemamo plačila preko PayPal-a. Med obdelavo plačil bodo nekateri vaši podatki poslani storitvi PayPal. Sem spadajo podatki, ki so zahtevani za obdelavo plačila ali podporo plačilom (skupen znesek, podatki o plačniku).','In this subsection you should list which third party payment processors you’re using to take payments on your store since these may handle customer data. We’ve included PayPal as an example, but you should remove this if you’re not using PayPal.'=>'V tem pododseku bi morali navesti, katere obdelovalnike plačil tretjih oseb uporabljate za sprejemanje plačil v vaši trgovini, saj lahko ti obravnavajo podatke o strankah. Kot primer smo vključili PayPal, vendar ga morate odstraniti, če ne uporabljate PayPala.','We share information with third parties who help us provide our orders and store services to you; for example --'=>'Delimo informacije s tretjimi osebami, ki nam pomagajo pri naročanju in storitvami za vas ; na primer --','In this section you should list who you’re sharing data with, and for what purpose. This could include, but may not be limited to, analytics, marketing, payment gateways, shipping providers, and third party embeds.'=>'V tem odseku morate navesti, s kom delite podatke in za kakšen namen. To lahko vključuje, vendar ni omejeno na, analitiko, trženje, plačilne sisteme, ponudnike dostave in vdelave tretjih oseb.','What we share with others'=>'Kaj delimo z ostalimi','Our team members have access to this information to help fulfill orders, process refunds and support you.'=>'Člani osebja imajo dostop do teh podatkov za pomoč pri izpolnitvi, vračilu in podpori strankam.','Customer information like your name, email address, and billing and shipping information.'=>'Podatki o stranki, kot so vaše ime, e-poštni naslov ter podatki plačnika in dostave.','Order information like what was purchased, when it was purchased and where it should be sent, and'=>'Podrobnosti o naročilu. Na primer, kaj je bilo kupljeno, kdaj je bilo kupljeno in kam naj se pošlje, ter','Members of our team have access to the information you provide us. For example, both Administrators and Shop Managers can access:'=>'Člani naše ekipe imajo dostop do podatkov, ki nam jih posredujete. Na primer, tako skrbniki kot vodje trgovin lahko dostopajo do:','Who on our team has access'=>'Kdo v naši ekipi ima dostop','We will also store comments or reviews, if you choose to leave them.'=>'Shanili bomo tudi komentarje in mnenja, če se jih odločite pustiti.','We generally store information about you for as long as we need the information for the purposes for which we collect and use it, and we are not legally required to continue to keep it. For example, we will store order information for XXX years for tax and accounting purposes. This includes your name, email address and billing and shipping addresses.'=>'Podatke o vas običajno hranimo tako dolgo, dokler jih potrebujemo za namene, za katere jih zbiramo in uporabljamo, in dokler smo jih zavezani hraniti po zakonu. Podatke o naročilu bomo na primer hranili XXX let za davčne in računovodske namene. To vključuje vaše ime, e-poštni naslov ter naslov plačnika in naslov dostave.','If you create an account, we will store your name, address, email and phone number, which will be used to populate the checkout for future orders.'=>'Če ustvarite račun, bomo shranili vaše ime, naslov, e-pošto in telefonsko številko, ki bodo uporabljeni za izpolnjevanje zaključka nakupa za prihodnja naročila.','Send you marketing messages, if you choose to receive them'=>'Pošiljanje tržnih sporočil, če se odločite za njihovo prejemanje','Improve our store offerings'=>'Izboljšanje ponudbe naše trgovine','Comply with any legal obligations we have, such as calculating taxes'=>'Upoštevanje vseh zakonskih obveznosti, ki jih imamo, kot je izračun davkov','Set up your account for our store'=>'Ustvaritev računa za uporabo naše trgovine','Process payments and prevent fraud'=>'Obdelovanje plačil in preprečevanje zlorab','Respond to your requests, including refunds and complaints'=>'Odzive na prošnje, vključno z vračili in pritožbami','Send you information about your account and order'=>'Pošiljanje podatkov o vašem računu in naročilu','When you purchase from us, we’ll ask you to provide information including your name, billing address, shipping address, email address, phone number, credit card/payment details and optional account information like username and password. We’ll use this information for purposes, such as, to:'=>'Ko kupujete pri nas, vas bomo prosili, da podate informacije, vključno z imenom, naslovom plačnika, naslovom za dostavo, e-pošto, tel. št., kreditno kartico/podrobnosti plačila in izbirne informacije računa, kot na primer up. ime in geslo. Podatke bomo uporabili za naslednje namene:','Note: you may want to further detail your cookie policy, and link to that section from here.'=>'Opomba: Če želite, lahko tu dodate povezavo o dodatnem pravilniku o piškotnih.','We’ll also use cookies to keep track of cart contents while you’re browsing our site.'=>'PIškotke uporabljamo tudi za sledenje vsebine košarice med brskanjem po naši spletni strani','Shipping address: we’ll ask you to enter this so we can, for instance, estimate shipping before you place an order, and send you the order!'=>'Naslov dostave: vprašali vas bomo, da vnesete naslov, da lahko npr. predvidimo dostavo preden oddate naročilo in vam nato pošljemo ponudbo!','Location, IP address and browser type: we’ll use this for purposes like estimating taxes and shipping'=>'Lokacija, naslov IP in vrsta brskalnika: uporabili jih bomo za predvidevanje davka in dostave','Products you’ve viewed: we’ll use this to, for example, show you products you’ve recently viewed'=>'Izdelki, ki ste si jih ogledali: to bomo uporabili, da vam npr. prikažemo izdelke, ki ste si jih nedavno ogledali','While you visit our site, we’ll track:'=>'Med obiskom naše strani, sledimo:','What we collect and store'=>'Kaj zbiramo in shranjujemo','We collect information about you during the checkout process on our store.'=>'Med zaključkom nakupa na naši spletni strani, zbiramo vaše podatke.','This sample language includes the basics around what personal data your store may be collecting, storing and sharing, as well as who may have access to that data. Depending on what settings are enabled and which additional plugins are used, the specific information shared by your store will vary. We recommend consulting with a lawyer when deciding what information to disclose on your privacy policy.'=>'Ta vzorec vključuje osnove o tem, katere osebne podatke lahko vaša trgovina zbira, shranjuje in deli, pa tudi o tem, kdo ima lahko dostop do teh podatkov. Podatki, ki jih lahko deli vaša trgovina, se bodo razlikovali glede na to, katere nastavitve so omogočene in kateri dodatni vtičniki se uporabljajo. Priporočamo, da se posvetujete z odvetnikom, ko se odločate, katere podatke razkriti v vašem pravilniku o zasebnosti.','Token'=>'Žeton','Payment Tokens'=>'Plačilni žetoni','Access granted'=>'Dostop dodeljen','Download count'=>'Število prenosov','User email'=>'E-pošta uporabnika','Browser User Agent'=>'User Agent brskalnika','Items Purchased'=>'Kupljeni izdelki','Order Number'=>'Številka naročila','Download ID'=>'ID prenosa','Access to Purchased Downloads'=>'Dostop do kupljenih prenosov','Purchased Downloads'=>'Kupljeni prenosi','Customer Data'=>'Podatki