učile nakupa. Izbrisana bodo po preteku določenega časa.','Retain failed orders'=>'Ohrani neuspela naročila','Pending orders are unpaid and may have been abandoned by the customer. They will be trashed after the specified duration.'=>'Naročila V obdelavi so neplačana, verjetno stranke niso zaključile nakupa. Izbrisana bodo po preteku določenega časa.','Retain pending orders '=>'Ohrani naročila v obdelavi','Inactive accounts are those which have not logged in, or placed an order, for the specified duration. They will be deleted. Any orders will be converted into guest orders.'=>'Neaktivni računi so tisti, v katere se nihče ni prijavil ali ni oddal naročila v določenem obdobju. Računi bodo izbrisani. Vsa naročila bodo pretvorjena v naročila gostov.','Retain inactive accounts '=>'Ohrani nedejavne račune','Choose how long to retain personal data when it\'s no longer needed for processing. Leave the following options blank to retain this data indefinitely.'=>'Izberite kako dolgo naj se ohranijo osebni podatki, ko niso več potrebni za obdelavo. Pustite prazno za ohranitev podatkov za nedoločen čas.','Personal data retention'=>'Ohranitev osebnih podatkov','Your personal data will be used to process your order, support your experience throughout this website, and for other purposes described in our %s.'=>'Vaše osebne podatke bomo uporabili za obdelavo oddanih naročil, za podporo pri uporabi spletne strani in druge namene, opisane v %s.','Optionally add some text about your store privacy policy to show during checkout.'=>'Izbirno dodajte besedilo o vašem pravilniku o zasebnosti, ki bo prikazano med zaključkom nakupa.','Checkout privacy policy'=>'Pravilnik o zasebnosti za zaključek nakupa','Your personal data will be used to support your experience throughout this website, to manage access to your account, and for other purposes described in our %s.'=>'Vaši osebni podatki bodo služili za izboljšavo vaše uporabniške izkušnje na naši spletni strani, za upravljanje dostopa do vašega računa in druge namene, opisane v %s.','Optionally add some text about your store privacy policy to show on account registration forms.'=>'Izbirno dodajte besedilo o vašem pravilniku o zasebnosti, ki bo prikazano na registracijskih obrazcih računa.','Registration privacy policy'=>'Pravilnik o zasebnosti za registracijo','privacy page'=>'Stran zasebnosti','This section controls the display of your website privacy policy. The privacy notices below will not show up unless a %s is set.'=>'Ta odsek nadzoruje prikaz pravilnika o zasebnosti vašega spletišča. Spodnja obvestila o zasebnosti ne bodo prikazana, razen če je nastavljen %s.','Privacy policy'=>'Pravilnik o zasebnosti','Removed personal data from %s order.'=>'Osebni podatki odstranjeni iz %s naročila.' . "\0" . 'Osebni podatki odstranjeni iz %s naročil.' . "\0" . 'Osebni podatki odstranjeni iz %s naročil.' . "\0" . 'Osebni podatki odstranjeni iz %s naročil.','Account erasure requests'=>'Prošnje za izbris računa','Accounts &amp; Privacy'=>'Računi in zasebnost','List of allowed billing emails to check against when an order is placed. Separate email addresses with commas. You can also use an asterisk (*) to match parts of an email. For example "*@gmail.com" would match all gmail addresses.'=>'Seznam dovoljenih e-poštnih naslovov plačnika, ki bodo preverjeni ob oddaji naročila. E-poštne naslove ločite z vejicami. Za ujemanje delov e-pošte lahko uporabite tudi zvezdico (*). Na primer "*@gmail.com" bi se ujemal z vsemi naslovi gmail.','Allowed emails'=>'Dovoljeni e-naslovi','Filter by registered customer'=>'Filtriraj po registrirani stranki','Remove personal data'=>'Odstrani osebne podatke','Use previous column mapping preferences?'=>'Uporabim možnosti preslikave predhodnega stolpca?','View &amp; Customize'=>'Ogled in urejanje','Review Settings'=>'Nastavitve Mnenj','Visit Dashboard'=>'Obišči nadzorno ploščo','You can also:'=>'Lahko tudi:','You\'re ready to add products to your store.'=>'Pripravljeni ste za dodajanje