ddress_override" za preprečitev spremembe podatkov naslova.','Address override'=>'Prepis naslova','Send shipping details to PayPal instead of billing.'=>'PayPalu posreduj podatke o dostavi namesto podatkov o plačniku.','Please enter a prefix for your invoice numbers. If you use your PayPal account for multiple stores ensure this prefix is unique as PayPal will not allow orders with the same invoice number.'=>'Vnesite predpono za številke vaših računov. Če uporabljate vaš PayPal račun za več trgovin, pazite da je ta predpona edinstvena, ker PayPal ne dopušča naročil z isto številko računa.','Invoice prefix'=>'Predpona računa','Optionally enable "Payment Data Transfer" (Profile > Profile and Settings > My Selling Tools > Website Preferences) and then copy your identity token here. This will allow payments to be verified without the need for PayPal IPN.'=>'Izbirno omogočite "Payment Data Transfer" (Profile > Profile and Settings > My Selling Tools > Website Preferences) in nato vstavite vaš identifikacijski žeton sem. To bo omogočilo preverjanje plačil brez potrebe po PayPal IPN-ju.','PayPal identity token'=>'PayPal Indentifikacijski žeton','If your main PayPal email differs from the PayPal email entered above, input your main receiver email for your PayPal account here. This is used to validate IPN requests.'=>'Če se vaš glavni PayPal e-naslov razlikuje od PayPal e-naslova vnesenega zgoraj, vnesite glavni e-naslov prejemnika za vaš PayPal račun sem. To se uporablja za potrjevanje IPN zahtev.','Receiver email'=>'E-mail prejemnika','Advanced options'=>'Napredne možnosti','Enable logging'=>'Omogočite zapisovanje v dnevnik (angl. logging)','Debug log'=>'Razhroščevalni dnevnik','Enable PayPal sandbox'=>'Omogočite PayPal sandbox','PayPal sandbox'=>'PayPal sandbox','Please enter your PayPal email address; this is needed in order to take payment.'=>'Vnesite vaš PayPal elektronski naslov; potrebno za sprejemanje plačil.','PayPal email'=>'PayPal e-pošta','Pay via PayPal; you ca