AP.','Your server does not have fsockopen or cURL enabled - PayPal IPN and other scripts which communicate with other servers will not work. Contact your hosting provider.'=>'Vaš strežnik nima omogočenega fsockopen ali cURL - PayPal IPN in ostale skripte, ki se sporazumevajo s strežniki ne bodo delovale. Stopite v stik s podjetjem, kjer gostujete vaše spletišče.','Payment gateways can use cURL to communicate with remote servers to authorize payments, other plugins may also use it when communicating with remote services.'=>'Plačilni sistemi lahko uporabljajo cURL za komuniciranje z oddaljenimi strežniki za odobritev plačil, prav tako lahko tudi drugi vtičniki uporabljajo med komunikacijo z oddaljenimi strežniki.','Default timezone is %s - it should be UTC'=>'Privzet časovni pas je %s - biti mora v obliki UTC','The default timezone for your server.'=>'Privzeti časovni pas vašega strežnika.','Default timezone is UTC'=>'Privzeti časovni pas je UTC','The largest filesize that can be uploaded to your WordPress installation.'=>'Največja dovoljena velikost datoteke, ki se lahko naloži v vašo WordPress stran.','Max upload size.'=>'Max velikost datotek.','The version of MySQL installed on your hosting server.'=>'Nameščena različica MySQL-a na vašem strežniku.','MySQL version.'=>'Različica MySQL.','Suhosin is an advanced protection system for PHP installations. It was designed to protect your servers on the one hand against a number of well known problems in PHP applications and on the other hand against potential unknown vulnerabilities within these applications or the PHP core itself. If enabled on your server, Suhosin may need to be configured to increase its data submission limits.'=>'Suhosin je napreden varnostni sistem za PHP namestitve. Oblikovan je bil z namenom zaščite vašega strežnika pred znanimi težavami PHP aplikacij in morebitnimi neznanimi ranljivostmi znotraj teh aplikacij ali samega jedra PHP-ja. Če je Suhosin omogočen na vašem strežniku, bo morda potreboval n